               <Typography color="primary" style={{fontWeight:"500",fontSize:"3rem",textAlign:"center"}} >Contact Us</Typography>
               <Typography component="p" varient="body1"  style={{textAlign:"center",width:"50%",margin:"0 auto",color:"#fff"}}  >
                 Lorem ipsum dolor sit amet consectetur adipisicing elit. Sit commodi dolor exercitationem modi. Nam asperiores maxime quae nulla, unde eius error minima, aliquid ut a officia ad dolor ratione repellat?

               </Typography>

                   </div>

        </div>
        </>
    )
}

export default Contact
